                writer.WriteBoolean("published", gameLevel.PublishedOption.Value!.Value);

            if (gameLevel.ContentNameOption.IsSet)
                writer.WriteString("contentName", gameLevel.ContentName);

            if (gameLevel.DefaultThresholdOption.IsSet)
                writer.WriteNumber("defaultThreshold", gameLevel.DefaultThresholdOption.Value!.Value);

            if (gameLevel.ContentAssetOption.IsSet)
            {
                writer.WritePropertyName("contentAsset");
                JsonSerializer.Serialize(writer, gameLevel.ContentAsset, jsonSerializerOptions);
            }
            if (gameLevel.ContentTypeOption.IsSet)
                writer.WriteString("contentType", gameLevel.ContentType);
        }
    }
}
